import "antd/dist/antd.css";
import PropTypes from "prop-types";
import React from "react";

const App = ({ Components }) => {
  return (
    <>
      <div>공통메뉴</div>
      <Components />
    </>
  );
};
App.prototype = {
  Components: PropTypes.elementType.isRequired,
};

export default App;
